const Multiplayer = ({ token }) => {

if (!token) {
    return <Redirect to='/' />
}

    return (
        <>
            <div>
                <ul className='messages' />
            </div>

            <form className='form' action=''>
            <input
                className='input'  
                type='text'
                autoComplete='off'
                placeholder='What would you like to say?'
                >
            </input>
            <button classname='btn btn-background-circle'
                >
                Send
            </button>
            </form>
        </>
    );
}

export default Multiplayer;
